import React from 'react'
type Props = {
    token:string
};

const HomeAdmin = (props: Props) => {
    fetch('http://localhost:8080/login', {
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
        }),
        mode: 'cors',
        method: 'GET',
      }).then((data) => data.text()).catch((error) => console.log(error));
    ;
    return (
        <div>HomeAdmin</div>
    )
    }
export default HomeAdmin;
